import {NavLink} from "react-router-dom"
import styles from "./Card.module.css";

const Card = (props) => {
  const dietNames = props.diet.map((diet) => diet.name).join(', ');

  return (
    <div className={styles.card}>
      <NavLink to="/detail">
        <h1>{props.name}</h1>
        <img src={props.image} alt={props.name} />
      </NavLink>
      <h2>DIET: {dietNames}</h2>
    </div>
  );
}

export default Card
